u64 ROR128(u64 x, int r)
{
    return (x >> r) | (x << ((sizeof(u64) * 8) - r));
}
u64 ROL128(u64 x, int r)
{
    return (x << r) | (x >> ((sizeof(u64) * 8) - r));
}
int xorU16(uint16_t n)// uint16_t internal xor
{
    uint8_t temp = 0;
    uint8_t* u = (uint8_t*)&n;
    temp = (*u) ^ (*(u+1));
    if(xor[temp]) return 1;
    else return 0;
}
